const Div = ({ padding, dataResponse }) => {
  return (
    <div>
      <div>Tiempo: {dataResponse.weather}</div>
      {dataResponse.icon ? (
        <div>
          <img
            src={`http://openweathermap.org/img/wn/${dataResponse.icon}@2x.png`}
          />
        </div>
      ) : null}
      <div style={{ padding: 5 }}>Temperatura: {dataResponse.temp}</div>
      <div style={{ padding: 5 }}>
        Sensación Térmica: {dataResponse.feels_like}
      </div>
      <div style={{ padding: 5 }}>
        Temperatura Mínima: {dataResponse.temp_min}
      </div>
      <div style={{ padding: 5 }}>
        Temperatura Máxima: {dataResponse.temp_max}
      </div>
      <div style={{ padding: 5 }}>Presión: {dataResponse.pressure}</div>
      <div style={{ padding: 5 }}>Humedad: {dataResponse.humidity}</div>
      <div style={{ padding: 5 }}>Visibilidad: {dataResponse.visibility}</div>
      <div style={{ padding: 5 }}>
        Velocidad de viento: {dataResponse.windSpeed}
      </div>
      <div style={{ padding: 5 }}>Amanecer: {dataResponse.sunrise}</div>
      <div style={{ padding: 5 }}>Atardecer: {dataResponse.sunset}</div>
    </div>
  );
};
